import React from "react";
import ResolCSS from '../styles/Resolution.module.css'

export default function Resolution({ data, num }) {

    function render() {
        if (data.type === 'radio') {
            data.answer.map((elem, index) => {

                return <label key={index}><input type="radio" name={num + '_answer'} />{elem}</label>

            })
        }
    }

    // let x = render()

    return <div className={ResolCSS.res}>
        <p>{num}. {data.textQUE}</p>

        {data.answer.map((elem, index) => {

            return <label key={index}><input type="radio" name={num + '_answer'} />{elem}</label>

        })}
    </div>
}
